fecive_date)=\'11\' then(\'Novomber\') When MONTH(ws.effecive_date)=\'12\' then(\'December\') else 0 end as Month, CASE  WHEN MONTH(ws.effecive_date)<=3 then 1 WHEN (MONTH(ws.effecive_date)>3 and MONTH(ws.effecive_date) <=6) then 2 WHEN (MONTH(ws.effecive_date)>6 and MONTH(ws.effecive_date) <=9) then 3 else 4 end as Quarter, YEAR(ws.effecive_date) as Year, wc.wastestream as wastestream , round(COALESCE(CASE  WHEN ws.unit=\'STUK\' THEN (id.weight*ws.number_of)  WHEN ws.unit=\'KG\'THEN (ws.number_of)   WHEN ws.unit=\'MAAND\'THEN(id.weight*ws.number_of*COALESCE(ff.clearfactor,0)*((DATEDIFF(ws.end_date,ws.effecive_date)+1)/30.4))  When ws.unit=\'TON\' THEN(ws.number_of*1000) else 0 END,0),0) as Final_Weight  , if(ws.eenheidsprijs>0,ws.net_costs,0) as costs, if(ws.eenheidsprijs<0,ws.net_costs,0)*-1 as revenue, wsm.co2_avoided*round(COALESCE(CASE  WHEN ws.unit=\'STUK\' THEN (id.weight*ws.number_of)  WHEN ws.unit=\'KG\'THEN (ws.number_of)   WHEN ws.unit=\'MAAND\'THEN(id.weight*ws.number_of*COALESCE(ff.clearfactor,0)*((DATEDIFF(ws.end_date,ws.effecive_date)+1)/30.4))  When ws.unit=\'TON\' THEN(ws.number_of*1000) else 0 END,0),0)/1000 as Co2, round(wsm.rawmaterial*round(COALESCE(CASE  WHEN ws.unit=\'STUK\' THEN (id.weight*ws.number_of)  WHEN ws.unit=\'KG\'THEN (ws.number_of)   WHEN ws.unit=\'MAAND\'THEN(id.weight*ws.number_of*COALESCE(ff.clearfactor,0)*((DATEDIFF(ws.end_date,ws.effecive_date)+1)/30.4))  When ws.unit=\'TON\' THEN(ws.number_of*1000) else 0 END,0),0),0) as RawMaterial, round(wsm.greenenergy*round(COALESCE(CASE  WHEN ws.unit=\'STUK\' THEN (id.weight*ws.number_of)  WHEN ws.unit=\'KG\'THEN (ws.number_of)   WHEN ws.unit=\'MAAND\'THEN(id.weight*ws.number_of*COALESCE(ff.clearfactor,0)*((DATEDIFF(ws.end_date,ws.effecive_date)+1)/30.4))  When ws.unit=\'TON\' THEN(ws.number_of*1000) else 0 END,0),0),0) as Greenenergy, round(wsm.greyenergy*round(COALESCE(CASE  WHEN ws.unit=\'STUK\' THEN (id.weight*ws.number_of)  WHEN ws.unit=\'KG\'THEN (ws.number_of)   WHEN ws.unit=\'MAAND\'THEN(id.weight*ws.number_of*COALESCE(ff.clearfactor,0)*((DATEDIFF(ws.end_date,ws.effecive_date)+1)/30.4))  When ws.unit=\'TON\' THEN(ws.number_of*1000) else 0 END,0),0),0) as greyenergy, round(wsm.waste*round(COALESCE(CASE  WHEN ws.unit=\'STUK\' THEN (id.weight*ws.number_of)  WHEN ws.unit=\'KG\'THEN (ws.number_of)   WHEN ws.unit=\'MAAND\'THEN(id.weight*ws.number_of*COALESCE(ff.clearfactor,0)*((DATEDIFF(ws.end_date,ws.effecive_date)+1)/30.4))  When ws.unit=\'TON\' THEN(ws.number_of*1000) else 0 END,0),0),0) as waste from am_wsdata_dataset ws left outer join itemdesc id  on (ws.article_desc=id.articledesc) LEFT outer join am_frequencyfactorschema_dataset ff on (ws.led_freq=ff.frequency)  LEFT OUTER JOIN am_wscode wc on(ws.Kostendrager=wc.code) LEFT OUTER JOIN am_master_dataset wsm on(wc.wastestream=wsm.wastestream)\",\"stagename\":\"AM_FinalDataStage\",\"stagedescription\":\"Stage for creating final dataset by extracting multiple data sources\",\"id\":11529}',1,'2015-07-17 12:43:23','user','2015-07-17 13:03:32','user'),(11531,'Agrimore_Final','DataSet','{\"name\":\"Agrimore_Final\",\"description\":\"Agrimore_Final\",\"location\":\"/user/zeas/agrimore1\",\"batchStructure\":\"YYYYMMDD\"}',1,'2015-07-17 13:23:25','user','2015-07-17 13:23:25','user'),(11535,'FlightsDelayData','DataSchema','{\"name\":\"FlightsDelayData\",\"type\":\"DataSchema\",\"dataAttribute\":[{\"Name\":\"Year\",\"dataType\":\"int\"},{\"Name\":\"Month\",\"dataType\":\"int\"},{\"Name\":\"DayofMonth\",\"dataType\":\"int\"},{\"Name\":\"DayOfWeek\",\"dataType\":\"int\"},{\"Name\":\"DepTime\",\"dataType\":\"string\"},{\"Name\":\"CRSDepTime\",\"dataType\":\"int\"},{\"Name\":\"ArrTime\",\"dataType\":\"string\"},{\"Name\":\"CRSArrTime\",\"dataType\":\"int\"},{\"Name\":\"UniqueCarrier\",\"dataType\":\"string\"},{\"Name\":\"FlightNum\",\"dataType\":\"int\"},{\"Name\":\"TailNum\",\"dataType\":\"string\"},{\"Name\":\"ActualElapsedTime\",\"dataType\":\"string\"},{\"Name\":\"CRSElapsedTime\",\"dataType\":\"int\"}